		<div>
			<p><strong>Question:</strong> What is the most significant thing you have learned about object oriented?</p>
			<p><strong>Answer:</strong> The most significant thing I've learned is how to setup accessors and mutators to retrieve and alter the data stored within objects.</p>
		</div>
		<hr />
		<div>
			<p><strong>Question:</strong> What is the most significant thing you have learned about the effect of the frontend on the backend?</p>
			<p><strong>Answer:</strong> The most significant thing I've learned is that it is necessary to design the front end in a way for users to easily access the data stored in the backend.</p>
		</div>
		<hr />
		<div>
			<p><strong>Question:</strong> Why is encapsulation so important?</p>
			<p><strong>Answer:</strong> Encapsulation is important because it prevents direct access to the object's state which could subvert the behavior. Encapsulation allows us to alter the state based on changes to methods defined by the behavior.</p>
